import copy
import time

'''
global dp dictionary
'''
dp = {}

'''
initializing dp dictionary with only two elements in the path
'''
def initDp(weightmatrix,start):
    nodekeys = list(weightmatrix.keys())
    endpoints = copy.deepcopy(nodekeys)
    endpoints.remove(start)

    for i in endpoints:
        dp[(start,i), i] = weightmatrix[start][i]
    print("Done initialization of dp")

'''
This function gives the minimum cost path through the boarding points that are present as keys in distance matrix
'''
def tspSolve(weightmatrix, start):
    nodekeys = list(weightmatrix.keys())
    initDp(weightmatrix,start)
    createDp(nodekeys,start = start)
    path = findPath(weightmatrix,dp,nodekeys,start=start)

    return path

'''
This computes the values in dp dictionary using tsp algorithm
currset is the set of elements in the path form start to end
'''
def dpcost(currset, end, weightmatrix):
    currset = tuple(currset)
    if (currset,end) in dp.keys():
        return dp[currset,end]
    
    if len(currset) == 2:
        dp[currset,end] = weightmatrix[start][end]
        return dp[currset,end]
    
    setnew = copy.deepcopy(list(currset))
    setnew.remove(end)
    setnew = tuple(setnew)
    minlist = []
    for j in currset:
        if j != end and j!=start:
            minlist.append(dpcost(setnew,j,weightmatrix) + weightmatrix[j][end])
    
    minimum = min(minlist)

    dp[currset,end] = minimum

    return dp[currset,end]

'''
This creates all the values in dp dictionary
'''
def createDp(currset,start = 0):
    t = time.time()
    for i in currset: 
        print(i)
        if i != start:
            dpcost(currset,i, weightmatrix)
            ti = time.time()
            print(ti - t)
    print("done create Dp")

'''
given a distance matrix and dp dictionary this gives us the minimum weight path
'''   
def findPath(weightmatrix, dp, currset, path = [], start= 0):
    currsetstart = tuple(currset)
    currset.remove(start)
    prevval = start
    path.append(start)
    while(len(currset) > 1):
        
        minimum = dp[currsetstart,currset[0]] + weightmatrix[currset[0]][prevval]
        minval = currset[0]
        for i in currset:
            if(minimum > dp[currsetstart,i] + weightmatrix[i][prevval]):
                minimum = dp[currsetstart,i] + weightmatrix[i][prevval]
                minval = i
        path.append(minval)
        currsetstart = copy.deepcopy(list(currsetstart))
        currsetstart.remove(minval)
        currsetstart = tuple(currsetstart)
        currset.remove(minval)
        prevval = minval
    
    path.append(currset[0])
    path.append(start)
    path.reverse()
    return path


