def createWeightMatrix(distancematrix, timematrix, alp, bet, avegspeed):
    weightmatrix = dict()
    for i in distancematrix.keys():
        for j in distancematrix[i].keys():
            weightmatrix[i][j] = alp*distancematrix[i][j] + avegspeed*bet*timematrix[i][j]
    
    return weightmatrix

def getCostVal(distancematrix, path):
    start = path[0]
    val = 0
    for i in path[1:]:
        val += distancematrix[start][i]
        start = i
    return val

